description:
Anubis ontwikkelt een nieuwe krachtige krijger. Een zoektocht naar technologie van de Ouden (Ancients) culmineert in de schijnbare vondst van Atlantis

5.Revisions - 11 juli 2003 - Op een planeet vol met giftige gassen ontdekt SG-1 een koepel met daarin een samenleving.

6.Lifeboat - 18 juli 2003 - SG-1 ontdekt een neergestort ruimteschip. In het schip vinden ze honderden ingevroren passagiers. Dan krijgt Daniel allemaal verschillende zielen in hem.

7.Enemy Mine - 25 juli 2003 - SGC probeert een naquadamijn te ontginnen. Hierbij worden ze aangevallen door een groep Unassen. Daniel en zijn Unas vriend Chaka gaan onderhandelen.

8.Space Race - 1 augustus 2003 - De kapitein van de Cerebus komt naar het SGC. Hij vraagt Carter haar hulp (en Naquada reactor) voor een ruimterace.



